import axios from "axios";

import { tokenHeader } from "../headersauth";
import Swal from "sweetalert2";
import { POST_BASESPACE, POST_BIOSAMPLE, ADD_ANALYSIS,DELETE_PROJECT, GET_BASESPACE } from "./types";
import { toast } from "react-toastify";

import "react-toastify/dist/ReactToastify.css";

toast.configure();

// projects
export const addBasespace = (project) => (dispatch) => {
  axios
    .post(`${process.env.REACT_APP_API_URL}/api/projects/`, project)
    .then((res) => {

      dispatch({
        type: POST_BASESPACE,
        payload: res.data,
      });
    })
    .catch((err) => {
      console.log("Error", err);
      if (err) {
        toast.error("Your project was not added plz check the details", {
          position: "top-right",
          autoClose: 2000,
        });
      }
    });
};
export const getProjectByID = id => async (dispatch) => {
  const res = await axios.get(`${process.env.REACT_APP_API_URL}/api/project/${id}/`);
  dispatch({
    type: GET_BASESPACE,
    payload: res.data
  });
};

export const deleteProject = (id) => (dispatch) => {
  axios
    .delete(`${process.env.REACT_APP_API_URL}/api/project/${id}/`)
    .then((res) => {

      dispatch({
        type: DELETE_PROJECT,
        payload: id,
      });
    })
    .catch((err) => console.log(err));
};

//Project ends

export const addBiosample = (project) => (dispatch) => {

  axios
    .post(
      `${process.env.REACT_APP_API_URL}/api/biosample/`,
      project,

    )
    .then((res) => {


      dispatch({

        type: POST_BIOSAMPLE,
        payload: res.data,
      });
    })
    .catch((err) => {
      console.log("Error", err);
      if (err) {
        toast.error("Biosamples was not added plz check the details", {
          position: "top-right",
          autoClose: 2000,
        });
      }
    });
};

export const addAnalysis = (project) => (dispatch) => {
  axios
    .post(
      `${process.env.REACT_APP_API_URL}/api/analysis/`,
      project,

    )
    .then((res) => {

      dispatch({
        type: ADD_ANALYSIS,
        payload: res.data,
      });
    })
    .catch((err) => {
      console.log("Error", err);
      if (err) {
        toast.error("Analysis was not added plz check the details", {
          position: "top-right",
          autoClose: 2000,
        });
      }
    });
  }
